import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
  Link
} from "react-router-dom";
import {Indexhvfelipe} from './hojasdevida/Hoja_de_vida_Felipe/Indexhvfelipe';

function hv()
{
  <><h1>Hola soy la funcion de la hoja de vida</h1><Indexhvfelipe /></>
}

function App() {
  return (
    <BrowserRouter>
      <nav class="menu">
        <ul>
        <li>
            <Link to="/"> Hoja de vida Juan Felipe</Link>
          </li>
          <li>
            <Link to="/hojadevidajuanfelipe"> Hoja de vida Juan Felipe</Link> 
          </li>
          <li>
          <Link to="/hojadevidajuanfelipe"> Hoja de vida Maria Fernanda</Link>
          </li>
          <li>
          <Link to="/contatenos"> Contactanos</Link>
          </li>
        </ul>
        <Routes>
          <Route path="/" element={<hv/>}/>
          <Route path="/hojadevidajuanfelipe" element={<hv/>}/>
        </Routes>
      </nav>
    </BrowserRouter>
  );
}

export default App;
